== 訓練機  ==

[[File:训练机.jpg|500px|右]]
對抗叫龍所開發的人型兵器「FRANXX」的訓練機。

駕駛艙位於頭部。

用以給操縱者候補生所使用。

武器為練習用扁平型器具。<s>飯勺</s>

在廣還未成為正式操縱者時曾多次用編號3的訓練機練習。

{{黑幕|動畫15話中，廣為了見02駕駛編號3的訓練機奔往戰場。}}{{黑幕|但因機體過於脆弱而被摧毀。}}

